import React from "react";
import Experience from "./components/Experience";
import Education from "./components/Education";
import About from "./components/About";
import ProgrammingSkills from "./components/ProgrammingSkills";
import SoftwareSkills from "./components/SoftwareSkills";
import Languages from "./components/Languages";
import experience from "./data/experience";
import education from "./data/education";
import programming from "./data/programming";
import software from "./data/software";
import language from "./data/language";



const App = () => {

    return (

            <div className="grid-container">
                <div className="item1">About</div>
                <div className="item2">
                    <h2>Programming Skills</h2>
                    <hr className="hr-item2"></hr>
                    <ul>
                        {programming.map(programming =>
                            <ProgrammingSkills key={programming.id} programming={programming} />
                            )}
                    </ul>
                    <h2>SOFTWARE SKILLS</h2>
                    <hr className="hr-item2"></hr>
                    <ul>
                        {software.map(software =>
                            <SoftwareSkills key={software.id} software={software} />
                            )}
                    </ul>
                    <h2>Languages</h2>
                    <hr className="hr-item2"></hr>
                    <ul>
                        {language.map(language =>
                            <Languages key={language.id} language={language} />
                            )}
                    </ul>
                </div>
                <div className="item3">
                    <h2>About me</h2>
                    <hr></hr>
                    <About />
                    <h2>Education</h2>
                    <hr></hr>
                    <ul>
                        {education.map(education => 
                            <Education key={education.id} education={education} />
                            )}
                    </ul>
                    <h2>Experience</h2>
                    <hr></hr>
                    <ul>
                        {experience.map(experience => 
                            <Experience key={experience.id} experience={experience} />
                        )}
                    </ul>
                </div>
            </div>
    )
}

export default App;
